import React from 'react';
import { Link } from 'react-router-dom';

const navbar = () => {
  return (
    <div>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/Podcasts">Podcasts</Link>
      </li>
      <li>
        <Link to="/MovieList">Movie List</Link>
      </li>
    </div>



  );
};
export default navbar;
